#include <time.h>
#include <stdlib.h>
#include <stdio.h>

class Solution {
public:
    int minMoves(vector<int>& nums) {
        
        int result_count = 0;
        
        quick_sort(nums);
        
        vector<int>::reverse_iterator rit;
        
        for(rit = nums.rbegin(); rit != nums.rend(); ++rit)
            result_count += (*rit - *nums.begin());
        
    	return result_count;
    }
private:
    void quick_sort(vector<int>& nums){

    	srand(time(NULL));

    	quick_sort_helper(nums, 0, nums.size() - 1);
    }
    void quick_sort_helper(vector<int>& nums, int start, int end){

    	int index = partition(nums, start, end);

    	if(start < (index - 1))
    		quick_sort_helper(nums, start, index - 1);  //<-- call something to update index!
    	if(index < end)
    		quick_sort_helper(nums, index, end);
    }
    int partition(vector<int>& nums, int start, int end){

    	int length    = (end - start) + 1;
    	int pivot_ind = (rand() % length) + start;
    	int pivot     = nums[pivot_ind];
    	
    	while(start <= end){    //the only terminating condition
    		while(nums[start] < pivot)
    			start++;
    		while(nums[end] > pivot)
    			end--;
    		if(start <= end){
    		    if(nums[start] != nums[end]){  //important! only works with two distinct numbers
    		                                   // samenum ^ samenum ==> 0!
        		    nums[start]  = nums[start] ^ nums[end];
                    nums[end]    = nums[start] ^ nums[end];
                    nums[start]  = nums[start] ^ nums[end];
        		}
    			start++;
    			end--;
    		}
    	}
    	return start;
    }
};

